rado','Frisco','TX',0,0,75034,32526,'(Effective Friday, April 1st, Chick-Fil-A Monthly Car & Truck Show is switching to the first Friday evening of each month rather than the first Saturday.) \"SPRING TOP 20, TOP 10 & BEST OF\" CARS & TRUCKS SHOW. Participant Registration 6-7:30 p.m. Mark your calendars and rev your engines! TROPHIES awarded based on Participant Voting. Also featuring Best of Show-Car, Best of Show-Truck, Chick-Fil-A Managers Choice, Peoples Choice and Outstanding Club Participation. (See Website for details) Slide Show Pics of all Participant Cars & Trucks shown on our website for you, your family and friends to enjoy! TROPHIES, TROPHIES, TROPHIES! Also, Rock n Roll to the sounds of 50s, 60s  90S music. Family fun for everyone including Hula Hoop & Jump Rope Contests, Prizes, Scavenger Hunts, Song Trivia and more. Antiques, Classics and Cutting-Edge Modern Day Classic Cars, Trucks & Cycles invited. This is a MSP Race For the Trophy Cup Series 2011 Points Competition Show. Each Registered Participant earns Points toward 1st, 2nd & 3rd Place Championship Trophies (6 ft, 4  ft and 3 ft) to be awarded! MAKE YOUR INDIVIDUAL, FAMILY AND CLUB PLANS NOW. BE THERE OR BE SQUARE!','Dan Herod','214-244-7296','','http://www.mustangsallyproductions.com',1,0,'0000-00-00','2011-11-30'),(14,1,6,3,1,NULL,'12:00:00','17:00:00','2011-11-19','2012-11-17',6,0,3,11,1,'$15.00','Remembering Christy Memorial Car Show',0,'','1980 S. Stemmons Freeway','Hooters Lewisville','Lewisville','TX',0,0,75067,32554,'A mother, a daughter, a friend, a classic car enthusiast, but was most known as the Queen of Car Shows. Memory Lane Car Shows and Hooters are teaming up for our second annual memorial. Registration: 12 pm - 2 pm. Ballots at 2:30PM, Silent Auction Closed at 4 pm, Awards before 5 pm. First 50 entries receive a dash plaque. Last year, with the support of David Hershey and TXA/CBS 11, we held our first fundraiser with all proceeds to the memorial fund set up by Christys mother Donna Cranor to help support Christys children. As many of you know, this was Christys first car show some eight years ago and unfortunately her last show, in September of last year. This location is very central for her family and loved ones and we would love for you to come out and share Christy\'s memories. We have added classes to this show to support the expected turnout of her loyal car show family with 30 classes, with 7 best of shows and some of Christys Favorites: Best Paint, Best Engine, Best Interior and Best Chrome. Awards donated by Hershmark Awards. We will also have a silent auction. If you have something new or a service you would like to donate, please contact me. Christy had a passion for cars and a passion to help people in need, evidenced by all the free shows she did over the years. You can donate by sending a check to Donna Cranor and write memorial fund for Christy in the memo . Mail to: PointBank, 4920 Long Prairie Rd., Flower Mound,TX. 75028. If you can help with this event, contact me.','Angela','469-383-6464','angela@memorylanecarshows.com','http://www.memorylanecarshows.com',1,0,'0000-00-00','2011-11-30'),(15,1,5,1,1,NULL,'13:00:00','13:00:00','2012-01-21','2014-01-18',6,0,3,0,1,'$10.00','Carrie\'s Fabulous 50\'s Car Show',0,'','9009 Main St','','Houston','TX',0,0,77055,33587,'kasdjfl;kajsdfl ;lkja;sldkfj lkasjd f lkjdlf s as dlkas;ldfkasldkfj ','Carrie','123-354-567','carrie@hermail.com','http://www.memorylanecarshows.com',1,0,'0000-00-00','2011-11-30'),(16,1,5,2,1,'https%3A%2F%2Fmaps.google.com%2Fmaps%3Fq%3D3001+Custer+Rd.%2BPlano%2C%2BTX%2B75075%26oe%3Dutf-8','17:00:00','21:00:00','2013-09-01','2016-08-07',0,0,1,0,1,'$10.','Monthly Muscle Car Show',0,NULL,'3001 Custer Rd.','','Plano','TX',25899,44,75075,32559,'Great car show brought to you by Monthly Muscle. 25 classes, including Under Construction. T-shirts and dash plaques to the first 50 entries. 52 awards, including Best of Show and Monthly Muscle Pick. Bring the family and have a 